window.bookSummaryJSON = "<p>I am a lesser? From a servant world? A nobody?<br> What a joke.<br> The man who discounts me is the one who loses.<br> Because me? I know royalty when I see it.<br> They call me the Kingmaker.<br> And I am never wrong.</p> <p>Even on an alien world, he will do anything to possess me.<br> The Prince of Blades.<br> His world is in shambles.<br> His conquerors have turned against him.<br> All because of a few pesky lessers like me.</p> <p>I can make him into an emperor.<br> I can fix his fractured world and bring his generals into line.<br> But he might not like who he has to become to win.<br> Us lessers aren't exactly who they thought we were, ha ha.<br> And me?<br> Well, I have a few secrets of my own.<br> And I'll only reveal those to a true king.</p> <p>Devour the next book in the enthralling, highly acclaimed Blades of Arris universe. One woman from Earth takes on the king of the conquerors, and the universe is never the same!</p>"; 
